Acesso gratuito à lista completa dos medicamentos similares equivalentes. Busque por nome, laboratório ou princípio ativo e veja como resultado o nome do medicamento de referência, qual o seu similar equivalente, laboratório e concentração da forma farmacêutica. 

O que é um similar equivalente?
É um medicamento que possui marca e nome próprio (ao contrário de um genérico) e tem o mesmo princípio ativo e em igual quantidade, forma farmacêutica e via de administração que o medicamento de referência (ou de "marca"), cumprindo os mesmos padrões de qualidade e desempenho. 

Funcionalidades:
- Busca por nome comercial, laboratório ou princípio ativo;
- Resultado com o medicamento referência (de marca), seu respectivo similar equivalente, laboratório e forma farmacêutica;
- Perguntas frequentes sobre os diferentes tipos de medicamentos (referência, genérico, similares e equivalentes);
- Atualização conforme a lista da Anvisa.
